import minilang.types

class MagicNumber(minilang.types.Magic):
    def __init__(self, value=None):
        self.value = value

    @staticmethod
    def get_value(self):
        return self.value

def add(a, b):
    if a is None or b is None:
        raise ValueError("Both a and b must be non-empty")
    return MagicNumber(a + b)
